import React from 'react';
import PropTypes from 'prop-types';
import dayjs from 'dayjs';

const Cell = ({ data }) => (
    <article className="project-container">
        <header>
            <div className='container'>
                <h4 className='name'>{data.name}</h4>
                <p className='icon'><a href={data.link}>{data.icon}</a></p>
                <p className='year'>{dayjs(data.startDate).format('MMMM YYYY')} - {data.endDate ? dayjs(data.endDate).format('MMMM YYYY') : 'PRESENT'}</p>
            </div>
        </header>
        <ul className="points">
            {data.summary.map((point) => (
            <li key={point}>{point}</li>
            ))
            }
        </ul>
  </article>
  );

const Project = ({ data }) => (
    <div className="Project">
        <div className="title">
          <h2>Projects</h2>
          <p>A selection of projects that I have done, and I'm still working in process</p>
        </div>
        {data.map((project) => (
            <Cell
            data={project}
            key={project.title}
            />
        ))}
    </div>
);

  Cell.propTypes = {
    data: PropTypes.shape({
      title: PropTypes.string.isRequired,
      link: PropTypes.string,
      image: PropTypes.string.isRequired,
      date: PropTypes.string.isRequired,
      desc: PropTypes.string.isRequired,
    }).isRequired,
  };

  export default Project;
